import Link from 'next/link';

const HamburgerToggle = props => (
    <button className="toggle-button">
        <div className="button-line">hi</div>
        <div className="button-line">twes</div>
        <div className="button-line"></div>
        <style jsx>{`
        .toggle-button {
            display: flex;
            flex-direction: column;
            margin-left: 0.5rem;
            height: 300px;
            width: 300px;  
            border: none;  
            cursor: pointer;    
        }

        .toggle-button:focus {
            outline:none;
        }

        .button-line {
            width: 300px;
            height: 100px:
            background: red;
        }
    `} </style>
    </button>
    
);

export default HamburgerToggle;
